import React from "react";
import { LOGO_image } from "../utils/constants";

const RestorentCard = (props) => {
    const { resData } = props;
    
    return (
      
        <div className="res-card">
              <div className="res-card-title">
                  <h1>{resData.info.title}</h1>
            </div>
            <img alt="logo" src={"https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_660/"+
            resData.info.cloudinaryImageId } />
            <h1>{resData.info.name}</h1>
            <h1>{resData.info.avgRating} . {resData.info.sla.slaString}</h1>
            <h1>{resData.info.costForTwo}</h1>
            <h1>{resData.info.locality}</h1>
           
           
        </div>


    )
}
export default RestorentCard;
